css:
.git-plus.output #root {
  height: 100%;
  margin: 0 5px;
  overflow-y: scroll;
}
.git-plus.output #root .record {
  margin: 5px 0;
}
.git-plus.output #root .record.has-output .line:hover {
  cursor: pointer;
}
.git-plus.output #root .record .line {
  display: flex;
  flex-direction: row;
}
.git-plus.output #root .record .line .gutter {
  width: 20px;
}
.git-plus.output #root .record .output {
  margin-left: 20px;
  margin-top: 5px;
}
.git-plus.output #root .record .output.collapsed {
  display: none;
}
